import React from 'react'

function Locations() {

  let map;

  window.onload= () => initMap();

  function initMap() {
    const myLatLng = { lat: -25.363, lng: 131.044 };
    const map = new window.google.maps.Map(document.getElementById("map"), {
      zoom: 4,
      center: myLatLng,
    });
    new window.google.maps.Marker({
      position: myLatLng,
      map,
      title: "Hello World!",
    });
  }
  return (

    <div id="map"></div>

  )
}

export default Locations
